"\nimport asyncio\nfrom playwright.async_api import async_playwright\n\n\nasync def run():\n    async with async_playwright() as p:\n        browser = await p.chromium.launch(headless=False)\n        page = await browser.new_page()\n\n\n await page.goto(\"https://google.com\")\n await page.fill(\"[name=q]\", \"search query\")\n await page.press(\"[name=q]\", \"Enter\")\n await page.wait_for_selector(\"#search\")\n await page.click(\"[href*='accounts.google.com/signin']\")\n await page.fill(\"[type=email]\", \"email@example.com\")\n await page.click(\"#identifierNext\")\n await page.fill(\"[type=password]\", \"password\")\n await page.click(\"#passwordNext\")\n await page.click(\"a[href='https://www.google.com/imghp']\")\n await page.fill(\"[name=q]\", \"image search query\")\n await page.press(\"[name=q]\", \"Enter\")\n await page.wait_for_selector(\".isv-r\")\n await page.click(\".isv-r\")\n await page.click(\"#settings-button\")\n await page.click(\"text=Search settings\")\n await page.wait_for_selector(\"#settings-form\")\n await page.click(\"#save\")\n await page.click(\".voice-search-button\")\n await page.click(\"button.allow-microphone\")\n await page.wait_for_selector(\".listening\")\n await page.wait_for_selector(\"#search\")\n\n        await browser.close()\n\n\nasyncio.run(run())\n"